Messages are ordinary structs, they do not require any odin_actor specific overhead other than that they for obvious reasons have to be Send and have to implement Debug (odin_actor requirement to support debug/logging). The odin_actor crate does define a number of system messages for lifetime control and monitoring purposes (_Start_, _Pause_, _Resume_, _Timer_, _Exec_, _Ping_, _Terminate_). Those messages do not have to be handled explicitly by actors (although they can, should the actor require specific actions). System messages can be sent to any actor. Message sets are the complete message interfaces of their associated actors. They are implemented as enums since we want to be able to statically (at compile time) check that an actor processes all message types in its interface (no "forgotten" messages) we can only send messages to actors who have this message type in their interface Other than for actor definition message set enums are mostly transparent, which means they need From<msg-type> impls for all their variants. Message sets have to include the system messages mentioned above. Since this would be tedious to define explicitly we provide the define_actor_msg_set!(..) macro that can be used like so: use odin_actor::prelude::*; #[derive(Debug)] struct MsgA(usize);
#[derive(Debug)] struct MsgB(usize); define_actor_msg_set! { MyActorMsg = MsgA | MsgB }
... This gets expanded to an enum type with From<T> impls for each of its variants: ...
enum MyActorMsg { MsgA(MsgA), MsgB(MsgB)
}
impl From<MsgA> for MyActorMsg {...}
impl From<MsgB> for MyActorMsg {...}
... The macro also adds variants for the system messages so that we can send them to each actor. Apart from automatic From<..> impls the main operation performed on message set enums is matching their variants inside of actor receive() functions. To avoid boilerplate and to make the code more readable we provide support matching on variant types from within the impl_actor! {..} macro: impl_actor! { match msg for Actor<MyActor,MyActorMsg> as MsgA => cont! { // process msg: MyActorMsg::MsgA } ... _Start_ => cont! { // process msg: MyActorMsg::_Start_ } However, Rust enum variants are not types, hence the framework automatically has to map type names (from the match arm patterns) to variant identifiers, which requires name mangling in case of generic types and tuples. This name mangling is performed automatically and uses similar valid unicode identifier characters (see odin_macro implementation) to ensure that compiler error messages are still readable. It should be noted that since we use enums to define message sets developers should be aware of the variant type sizes - Rust enums are sized to accommodate the largest of their variants and mailboxes represent arrays of respective message set enums. Use Arc<MyLargeType> in case variants can get large.

