The odin_actor crate uses a single generic actor type pub struct Actor <S,M> where S: Send + 'static, M: MsgTypeConstraints { pub state: S, pub hself: ActorHandle<M>,
} where the type variable S represents the user defined actor state type and the type variable M represents the actor message set type defined by a corresponding define_actor_msg_set!(..) invocation. The Actor type itself is mostly transparent, usually it is only visible at the location where a concrete actor is defined with the impl_actor! { ... } macro. To avoid boilerplate in the associated message matcher code odin_actor provides blanket Deref and DerefMut impls that forward to the state: S field. For the most part, developers can treat actor and actor state synonymously. One consequence of not having constraints on the actor state type and keeping system related data in the framework provided Actor<S,M> struct is that we need to pass actor handles into inherent impl methods like so: struct MyActor {...} impl MyActor { async fn send_something (&mut self, hself: &ActorHandle<MyActorMsg>) { hself.send_msg(...).await } ...
} impl_actor! { match msg for Actor<MyActor,MyActorMsg> as ... => cont! { self.send_something( &self.hself).await } ...
} We define concrete Actor types by means of our impl_actor!{..} macro, which has the primary purpose of generating a ActorReceiver<M> trait impl for the concrete Actor type. This trait defines the function fn receive (&mut self, msg: MsgType)-> impl Future<Output = ReceiveAction> + Send which is our actor message dispatcher (a matcher on the actor message set enum variants). Once it is spawned at runtime the Actor is moved into its own Tokio task. Since the Actor owns the actor state S this guarantees actor encapsulation - it is not visible to the outside anymore. The task in turn consists of a loop that awaits incoming messages from the actor mailbox (task channel reader part) and then dispatches the message through the receive() function of the ActorReceiver impl. Each receive match arm has to return a ReceiveAction enum that tells the task how to proceed: ReceiveAction::Continue continues to loop, waiting for the next message to receive ReceiveAction::Stop breaks the loop and terminates message processing for this actor. This is the default result when dispatching _Terminate_ system messages ReceiveAction::RequestTermination sends a termination request to the associated ActorSystem but continues to loop. The ActorSystem in turn sends _Terminate_ messages to all its actors in response The system provides the cont!{..}, stop!{..} and term!{..} macros as syntatic sugar to make sure match arm expressions do return respective ReceiveAction values.

