} Both define_actor_msg_set!{..} and impl_actor!{..} automatically translate generic message types (e.g. Query<Q,A>) into valid variant names of the actor message set. Although this mapping is readable and intuitive the programmer does not need to know (other than to understand related compiler error messages). Using an enum to encode all possible input messages for an actor also explains why message types should not be large. Not only would this increase clone() cost but it also would enlarge the message set enum, which is sized according to its largest variant. Since this message set enum is the type of the actor mailbox (channel) this size matters - a Rust enum is sized according to its largest variant. If the ratio of max to min size of variants is too large then the channel can waste a lot of memory. If this is a problem we can always wrap (part of) large messages within heap-allocated containers (Box, Arc, Vec etc.) which collapses the size of the wrapped data to a pointer.

