use odin_hrrr::{load_config,HrrrActor, AddDataSet, HrrrConfig, schedule::{HrrrSchedules,get_schedules}, HrrrDataSetRequest, HrrrDataSetConfig, HrrrFileAvailable}; define_cli! { ARGS [about="NOAA HRRR download example using HrrrActor"] = hrrr_config: String [help="filename of HRRR config file", short,long,default_value="hrrr_conus.ron"], statistic_schedules: bool [help="compute schedules of available forecast files from server dir listing", short, long], ds_config: String [help="filename of HrrrDataSetConfig file"]
} run_actor_system!( actor_system => { let hrrr_config: HrrrConfig = load_config( &ARGS.hrrr_config)?; let schedules: HrrrSchedules = get_schedules( &hrrr_config, ARGS.statistic_schedules).await?; let ds: HrrrDataSetConfig = load_config( &ARGS.ds_config)?; let req = Arc::new(HrrrDataSetRequest::new(ds)); let himporter = spawn_actor!( actor_system, "hrrr_importer", HrrrActor::new( hrrr_config, schedules, data_action!( => |data: HrrrFileAvailable| { println!("file available: {:?}", data.path.file_name().unwrap()); Ok(()) }) ))?; actor_system.start_all().await?; himporter.send_msg( AddDataSet(req)).await?; actor_system.process_requests().await?; Ok(())
});
